import React from 'react'

const Employees = () => {
  return (
    <div class="flex justify-center items-center font-sans max-w-2xl bg-green-400">
        <table class="table-auto">
            <thead>
                <tr>
                </tr>
            </thead>
            <th>ID</th>
            <th>Name</th>
            <th>Designation</th>
            <th>Salary</th>
        </table>
    </div>
  );
}

export default Employees;
